  _globals['_ROLESSERVICE'].methods_by_name['ListEffectiveRolePermissions']._serialized_options = b'\222A\222\010\n\005Roles\022#List effective permissions for role\032\331\005Retrieves the complete set of effective permissions for a role, including both directly assigned permissions and permissions inherited from base roles through the role hierarchy. Use this endpoint to understand the full scope of capabilities available to users assigned to a specific role. Provide the role name as a path parameter, and the response will include all permissions that apply to the role, accounting for inheritance relationships. This operation is essential for auditing role capabilities, understanding permission inheritance, or verifying the complete access scope before role assignment. Returns a comprehensive list of permission names representing the full set of effective permissions for the specified role.J\207\002\n\003200\022\377\001\n\277\001Successfully retrieved effective permissions. Returns the complete list of all permissions that apply to the role, including both direct assignments and inherited permissions from base roles.\022;\n9\0327.scalekit.v1.roles.ListEffectiveRolePermissionsResponse\202\265\030\002\030T\202\323\344\223\002+\022)/api/v1/roles/{role_name}/permissions:all'
